class Login extends Component {
  render() {
    return (
      <div className="Login">
      <InputGroup>
      <Input placeholder="username" />
      <InputGroupAddon addonType="append">@example.com</InputGroupAddon>
      </InputGroup>
//<p>Corporate email:
//<input type="textfield"/> </p>
<p>Password:
<input type="textfield"/> </p>
<Button color="primary">Login</Button>{' '}
      </div>
    );
  }
}

export default Login;
